import { makeStyles } from "@mui/styles"


export const useStyles = makeStyles({
  logo:{
    color:"black",
  },
  headere:{
    textAlign:'left',
    backgroundColor:'white',
    boxShadow:'none'
  },
  itemMenu:{
    color:'black'
  },
  menu:{
    display:'flex',
    marginLeft:'20px',
    width:'20%',
    justifyContent:'space-between'
  }
})
